const HelpIcon = ({ icon }: { icon: string }) => {
  switch (icon) {
    case "whatsapp":
      return <WhatsappIcon />;
    case "email":
      return <EmailIcon />;
    case "timer":
      return <TimerIcon />;
    default:
      return <WhatsappIcon />;
  }
};

